import React from "react";
const Cards = () => {

    function GenerateCards () {

        let array = []
        for(let i = 0; i < 12; i++) { 
            array.push(i)
        }
        let divs = array.map((element) => {
            return <li>{element}</li>
        })
        return divs
    }


    return (
        <div className="cards">
            <GenerateCards/>
        </div>
    )
}

export default Cards;
